// Audit & Prepare Data - Extract and structure API response

const rawResponse = $input.first().json;
const fetchedAt = new Date().toISOString();
const leaderboard = rawResponse.leaderboard || {};

// Extract metadata
const eventCode = leaderboard.code || 'hJjW-WXu-oCGQ';
const eventName = leaderboard.name || 'Unknown Event';
const startDate = leaderboard.start_date || null;
const stopDate = leaderboard.stop_date || null;

// Extract arrays safely
const titles = Array.isArray(leaderboard.titles) ? leaderboard.titles : [];
const scores = Array.isArray(leaderboard.scores) ? leaderboard.scores : [];

// Create machine code map (title_name -> title_code)
const machineMap = {};
titles.forEach(title => {
  machineMap[title.title_name] = title.title_code;
});

// Flatten and structure scores
const structuredScores = scores.map(score => ({
  player_id: score.username,
  machine_id: machineMap[score.title_name],
  high_score: score.score,
  date_set: fetchedAt,
  event_code: eventCode,
  score_source: 'API',
  is_approved: true,
  display_name: score.username,
  initials: score.initials,
  avatar_url: score.avatar_path,
  background_color_hex: score.background_color_hex,
  is_all_access: score.is_all_accesss || false,
  title_name: score.title_name
}));

// Output metadata for event upsert
const metadata = {
  event_code: eventCode,
  event_name: eventName,
  start_date: startDate,
  stop_date: stopDate,
  fetched_at: fetchedAt,
  raw_response: rawResponse
};

// Return both outputs
return [
  [{ json: metadata }],
  structuredScores.map(s => ({ json: s }))
];
